#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define MAX 200005
#define MAXS 11

typedef struct {
    char str[MAXS];
    int count;
} Vote;

int compare(const void *a, const void *b) {
    Vote *x = (Vote *)a;
    Vote *y = (Vote *)b;
    return strcmp(x->str, y->str);
}

int main() {
    int n;
    scanf("%d", &n);
    Vote *votes = (Vote *)malloc(n * sizeof(Vote));
    for (int i = 0; i < n; i++) {
        scanf("%s", votes[i].str);
        votes[i].count = 1;
    }
    qsort(votes, n, sizeof(Vote), compare);
    int max = 0;
    for (int i = 0; i < n; i++) {
        if (i == n - 1 || strcmp(votes[i].str, votes[i + 1].str) != 0) {
            if (votes[i].count > max) {
                max = votes[i].count;
                printf("%s\n", votes[i].str);
            }
        } else {
            votes[i + 1].count += votes[i].count;
        }
    }
    free(votes);
    return 0;
}
